import React, {Component} from 'react';
import {Text, View, ActivityIndicator} from 'react-native';
import {WebView} from 'react-native-webview';
var SharedPreferences = require('react-native-shared-preferences');
import DefaultPreference from 'react-native-default-preference';

const html = `
<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Document</title>
  </head>
  <body>
    <h4>html body</h4>
    <button onclick="sendData()">Send Data</button>
    <script>
      function sendData() {
        let d = "";
        window.ReactNativeWebView.postMessage(JSON.stringify({value: d}));
      }
    </script>
  </body>
</html>

`;

class MyWeb extends Component {
  state = {
    cmpdata: undefined,
    loading: false,
  };
  componentDidMount() {
    // SharedPreferences.getItem('cmpdata', value => {

    // });

    DefaultPreference.get('cmpdata')
      .then(value => {
        console.log(value);
        this.setState({cmpdata: value});
      })
      .catch(e => {
        console.log('ee', e);
      });
  }
  goBack = () => {
    this.props.navigation.pop();
  };
  srcfile = require('./index.html').toString();
  render() {
    return (
      <>
        <WebView
          ref={webView => (this.webView = webView)}
          source={{
            html: html,
          }}
          style={{marginTop: 0, backgroundColor: 'orange'}}
          scalesPageToFit={true}
          onLoad={() => {
            this.setState({loading: false});
            console.log('loaded');
          }}
          onError={e => {
            console.log('error', e);
          }}
          onMessage={e => {
            console.log('mess', e.nativeEvent.data);
          }}
        />
        {this.state.loading && (
          <ActivityIndicator
            style={{
              flex: 1,
              left: 0,
              right: 0,
              top: 0,
              bottom: 0,
              position: 'absolute',
              alignItems: 'center',
              justifyContent: 'center',
            }}
            size="large"
          />
        )}
      </>
    );
  }
}

export default MyWeb;
